import React from 'react'
import { IconHeader, HeaderTextContainer, ProfileContainer, ProfileImageContainer } from '../lib/container'
import { Icon } from '../lib/icons'

export const Header = () => {

  return (
    <IconHeader>
      <Icon href='https://www.linkedin.com/in/jihyun-an-405431150/' src={require('../assets/linkedin-white-desktop.svg')} alt='linkedin' />
    </IconHeader>
  )
}

export default Header
